  false,\n\t\"url\": null,\n\t\"notes\": \"The water-budget components geodatabase
  contains selected data from maps in the, \"Selected Approaches to Estimate Water-Budget
  Components of the High Plains, 1940 through 1949 and 2000 through 2009\" report
  (Stanton and others, 2011). Data were collected and synthesized from existing climate
  models including the Parameter-Elevation Regressions on Independent Slopes Model
  (PRISM) (Daly and others, 1994), and the Snow accumulation and ablation model (SNOW-17)
  (Anderson, 2006),and used in soil-water balance models to compute various components
  of a water budget. The methodologies used to compute the averages and volumes for
  the data in this geodatabase are slightly different for different components and
  models.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
